import React, { useEffect, useState } from 'react'

function ButtonActiveted(props) {
    const [projectActiveted, useprojectActiveted] = useState(false)
    // console.log(props)
    props.projects.forEach(el => {
        props.pageDetail.post.forEach(element => {
            if (element.idPost == el.post.idPost && el.live) {
                useprojectActiveted(true)
            } else {
                useprojectActiveted(false)
            }
        })
    })
    return (
        <div>
            {
                projectActiveted ? 'active' : 'desactivated'
            }
        </div>
    )
}

export default ButtonActiveted
